    string aparqsaction( )
    {
        int plant=0;
        int prod =0;
        try{
            plant =Convert.ToInt32(ViewData["Plant"].ToString());
        }
        catch{}
        try{
            prod =Convert.ToInt32(ViewData["Prod"].ToString());
        }
        catch{}
        string ret ="?plant="+plant.ToString()+"&prod="+prod.ToString()+"&id=";
        return ret;
    }

    string [] Controller(string table){
        string [] retur = new string [4];
        switch (table)
        {
        case "Product":
                retur[0]="TCustomer";
                retur[1]="ProEdit";
                retur[2]="ProCreate";
                retur[3]="ProDelete";
                break;
        case "CPlant":
                retur[0]="TCustomer";
                retur[1]="PlantEdit";
                retur[2]="PlantCreate";
                retur[3]="PlantDelete";
                break;
        case "CPlann":
                retur[0]="TCustomer";
                retur[1]="PlanEdit";
                retur[2]="PlanCreate";
                retur[3]="PlanDelete";
                break;
        case "CPO":
                retur[0]="TCustomer";
                retur[1]="PoEdit";
                retur[2]="PoCreate";
                retur[3]="PoDelete";
                break;
        default:
            break;
        }
        return retur;
    }
